    <style>
        body {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
            font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
            display: flex;
            justify-content: center;
            align-items: center;
            min-height: 100vh;
            background-color: #f0f0f0;
            position: relative; /* Added for positioning the settings button */
        }

        .gallery {
            display: grid;
            grid-template-columns: repeat(auto-fit, minmax(250px, 1fr));
            gap: 20px;
            padding: 20px;
        }

        .gallery img {
            width: 100%;
            height: auto;
            cursor: pointer;
            border-radius: 8px;
            transition: transform 0.2s ease-in-out;
        }

        .gallery img:hover {
            transform: scale(1.05);
        }

        .modal {
            display: none;
            position: fixed;
            z-index: 1000;
            left: 0;
            top: 0;
            width: 100%;
            height: 100%;
            background-color: rgba(0, 0, 0, 0.8);
            justify-content: center;
            align-items: center;
        }

        .modal img {
            max-width: 80%;
            max-height: 80%;
        }

        .close {
            position: fixed;
            top: 20px;
            right: 40px;
            font-size: 2rem;
            color: #fff;
            cursor: pointer;
        }

        /* Style for settings button */
        .settings-button {
            position: absolute;
            top: 20px;
            right: 20px;
            background-color: #ffffff;
            border: 1px solid #cccccc;
            padding: 8px 16px;
            border-radius: 4px;
            cursor: pointer;
        }

        /* Style for settings modal */
        .settings-modal {
            padding: 20px;
            background-color: #ffffff;
            border: 1px solid #cccccc;
            position: absolute;
            top: 60px;
            right: 20px;
            z-index: 1000;
            display: none;
        }

        /* Style for settings options */
        .settings-option {
            margin-bottom: 10px;
        }

        /* Style for about information */
        .about-info {
            margin-top: 10px;
            font-size: 14px;
        }
    </style>
</head>

<div class="modal" onclick="closeModal()">
    <span class="close">&times;</span>
    <img class="modal-content">
</div>

<!-- Settings button -->
<div class="settings-button" onclick="showSettings()">Settings</div>

<!-- Settings modal -->
<div class="settings-modal" id="settingsModal">
    <div class="close-settings" onclick="closeSettings()">&times;</div>
    <div class="settings-option">
        <label for="imageSize">Image Size:</label>
        <select id="imageSize" onchange="changeImageSize(this.value)">
            <option value="100%">Default</option>
            <option value="80%">80%</option>
            <option value="60%">60%</option>
            <option value="40%">40%</option>
        </select>
    </div>
    <button onclick="showAbout()">About</button>
    <div class="about-info" id="aboutInfo" style="display:none;">
        <p>Webapp version: 1.0</p>
        <p>Made by ChatGPT</p>
        <p>Owner is skyhighsundae</p>
    </div>
</div>

<script>
    const modal = document.querySelector('.modal');
    const modalContent = document.querySelector('.modal-content');
    const closeModalButton = document.querySelector('.close');
    const settingsModal = document.getElementById('settingsModal');
    const imageSizeSelect = document.getElementById('imageSize');
    const aboutInfo = document.getElementById('aboutInfo');

    // Load settings from cookies on page load
    window.addEventListener('load', function() {
        const savedImageSize = getCookie('imageSize');
        if (savedImageSize) {
            imageSizeSelect.value = savedImageSize;
            changeImageSize(savedImageSize);
        }
    });

    // Show settings modal
    function showSettings() {
        settingsModal.style.display = 'block';
    }

    // Close settings modal
    function closeSettings() {
        settingsModal.style.display = 'none';
    }

    // Prevent settings modal from closing when clicked inside
    settingsModal.addEventListener('click', function(event) {
        event.stopPropagation();
    });

    // Update image size based on settings
    function changeImageSize(size) {
        applyImageSize(size);
        // Save selected image size to cookie
        setCookie('imageSize', size, 30); // Expires in 30 days
    }

    function applyImageSize(size) {
        const images = document.querySelectorAll('.gallery img');
        images.forEach(img => {
            img.style.width = size;
        });
    }

    // Helper function to set cookie
    function setCookie(name, value, days) {
        const expires = new Date();
        expires.setTime(expires.getTime() + days * 24 * 60 * 60 * 1000);
        document.cookie = name + '=' + value + ';expires=' + expires.toUTCString();
    }

    // Helper function to get cookie value
    function getCookie(name) {
        const keyValue = document.cookie.match('(^|;) ?' + name + '=([^;]*)(;|$)');
        return keyValue ? keyValue[2] : null;
    }

    // Show modal with clicked image
    function showModal(src) {
        modal.style.display = 'flex';
        modalContent.src = src;
    }

    // Close modal
    function closeModal() {
        modal.style.display = 'none';
    }

    // Close modal when close button is clicked
    closeModalButton.addEventListener('click', function(event) {
        event.stopPropagation();
        closeModal();
    });

    // Show About information
    function showAbout() {
        aboutInfo.style.display = 'block';
    }
</script>

</body>
</html>
